import React,{useRef} from 'react'

function Form () {
    const ref1 = useRef()
    const ref2 = useRef()
    const ref3 = useRef()

    const Click = () => {
        let name1 = ref1.current.value;
        let email = ref2.current.value;
        let pass = ref3.current.value;
    }
    
    console.log(name1,email,pass)

    return(
        <div>
          <input ref={ref1} type="text"  />
          <input ref={ref2} type="text"  />
          <input ref={ref3} type="text"  />
          <button onClick={Click}>Click</button>
        </div>
    )
}

export default Form;
